import sys
sys.setrecursionlimit(10000)

last_num = []
new_num = [0]


def fibonacci(num):
    new_num[0] = num + last_num[0]
    last_num[0] = new_num[0] - num
    print(len(str(new_num[0])))
    if len(str(new_num[0])) == 1000:
        print(str(new_num[0]))
        sys.exit()
    else:
        last_num[0] = num
        fibonacci(new_num[0])

fibonacci()